import styled from "styled-components";

const Container = styled.div``;

const Register = () => {
  return <Container>
    <Wrapper>
      <Title>CREATE AN ACCOUNT</Title>
      <Form>
        <Input/>
      </Form>
    </Wrapper>
  </Container>;
};

export default Register;
